// Find the root element in your HTML
const rootElement = document.getElementById('root');

// Create a root using ReactDOM.createRoot (React 18+)
const root = ReactDOM.createRoot(rootElement);

// Render the React App
root.render(
    <React.StrictMode>
        <App />
    </React.StrictMode>
);
